import React from 'react';
import ReactDOM from 'react-dom';
import * as calculator from "./Calculator";
import './index.css';

ReactDOM.render(
  <>
    <ul>
      <li>Sum of two numbers is {calculator.add()}</li>
      <li>Multiplication of two numbers is </li>
    </ul>
  </>, document.getElementById("root")
)
